import React from "react";
import { Navbar } from "react-bootstrap";

const Bottom = () => {
   return (
      <React.Fragment>
         <Navbar
         fixed="bottom"
         className="navbar navbar-expand-sm bg-light justify-content-center"
         bg="dark"
         style={{ color: "white" }}
         >
         자바수용소 Copyright&copy;2023
         </Navbar>
      </React.Fragment>
   );
   };

export default Bottom;
